import React, { Component } from "react";
import axios from "axios";

export default class EditTour extends Component {
  constructor(props) {
    super(props);
    this.state = {
      id: this.props.id
    };
  }
  componentDidMount() {}
  render() {
    return (
      <div>
        <label>Tour</label>
        <input placeholder="tour" />
      </div>
    );
  }
}
